INSERT INTO `posts` VALUES (1, '1', 'JAVA学习', 'Java是半编译半解释性语言，它将.java的源程序文件编译成拓展名为.class的字节码文件，字节码文件可以在任何一台装有JVM虚拟机的操作系统上运行，从而达到“一次编译，随处运行”的目的。 Java 特点：简单的 面向对象的 分布式的 解释执行的 健壮的 安全的 结构中立的 可移植的 高效率的 多线程的 动态的和跨平台的编程语言。 Java的三个平台标准：Java SE4（标准版：用于开发桌面应用程序） Java EE（企业版：用于开发和部署服务端的应用程序） Java ME（移动端：已被安卓、IOS、鸿蒙OS所淘汰）。', '2022-03-27 17:40:08');
INSERT INTO `posts` VALUES (2, '1', 'TypeScript学习', 'TypeScript 是微软推出的一门语言TypeScript 是JavaScript 的超集，包含 ES新增了类型系统和完整的面向对象语法使用 TS 编写的项目更加健硕，更加便于扩展和维护', '2022-03-27 17:40:08');
INSERT INTO `posts` VALUES (3, '2', 'MySQL学习', '在学习MySQL的时候，我选择的是mysql命令行实用程序，因为它对于快速测试和执行脚本非常有价值，并且便于传播与存储。我们首先输入命令来连接到MySQL，连接的时候需要输入我们安装时候设置的root密码。在这里使用了root用户登录到mysql服务器，我们也可以使用其他mysql用户登录。', '2022-03-27 17:40:08');
INSERT INTO `posts` VALUES (4, '2', 'Spring Boot学习路线', '  Spring Boot 学习路线，本文计划根据作者近几年的工作、学习经验，来分析和制定一个学习使用 Spring Boot技术的步骤路线图。\n\n SpringBoot是伴随着Spring4.0诞生的； SpringBoot的目标是简化Spring的开发过程、让开发者快速搭建框架和web容器。并为微服务提供更好的支持，提供服务监控能力。Spring为开发者带来了简单和能力：\n\n Spring Boot使编码变简单\n\nSpring Boot使配置变简单\n\nSpring Boot使监控变简单\n\nSpring Boot使部署变简单', '2022-03-27 17:40:08');
INSERT INTO `posts` VALUES (6, '1', 'Typescript 3.1', '<h1>元组和数组上的映射类型</h1><p>TypeScript 3.1，在元组和数组上的映射对象类型现在会生成新的元组/数组，而非创建一个新的类型并且这个类型上具有如<code>push()</code>，<code>pop()</code>和<code>length</code>这样的成员。 例子：</p><pre><br/><code>type MapToPromise&lt;T&gt; = { [K in keyof T]: Promise&lt;T[K]&gt; };\n\ntype Coordinate = [number, number]\n\ntype PromiseCoordinate = MapToPromise&lt;Coordinate&gt;; // [Promise&lt;number&gt;, Promise&lt;number&gt;]\n</code></pre><p><code>MapToPromise</code>接收参数<code>T</code>，当它是个像<code>Coordinate</code>这样的元组时，只有数值型属性会被转换。&nbsp;<code>[number, number]</code>具有两个数值型属性：<code>0</code>和<code>1</code>。 针对这样的数组，<code>MapToPromise</code>会创建一个新的元组，<code>0</code>和<code>1</code>属性是原类型的一个<code>Promise</code>。 因此<code>PromiseCoordinate</code>的类型为<code>[Promise&lt;number&gt;, Promise&lt;number&gt;]</code>。</p>', '2022-03-28 19:38:25');
